script: |
  super -f text -I q966.spq | sort > q966.out

inputs:
  - name: q966.spq
    data: |
      SELECT DISTINCT + + col1 + - col2 AS col0 FROM tab2 (FORMAT parquet) WHERE - + 76 + + - 65 NOT BETWEEN 61 AND + + CAST ( - 87 AS INTEGER );
  - name: tab2

outputs:
  - name: q966.out
    data: |
      28
      37
      9
